import React from "react";
import s from './Profile.module.css';
import MyPosts from "./My Posts/MyPosts";

const Profile = () => {
    return (
        <div className={s.Profile}>
            <div>
                <img
                    src='https://st4.depositphotos.com/20524830/i/600/depositphotos_257969776-stock-photo-wide-panorama-beautiful-sunrise-landscape.jpg'/>
            </div>
            <div>
                ava
            </div>
            <MyPosts />
        </div> )
}

export default Profile;
